      raw: '{"data":{},"content":[{"data":{},"content":[{"data":{},"marks":[],"value":"","nodeType":"text"},{"data":{"uri":"https://thamesandhudson.com/living-with-matisse-picasso-and-christo-9780500970607"},"content":[{"data":{},"marks":[],"value":"Thames & Hudson","nodeType":"text"}],"nodeType":"hyperlink"},{"data":{},"marks":[],"value":", 2018\\nEdited by Carrie Pilto\\nContributions by Staffan Ahrenberg, Olivier Berggruen, Daniel Birnbaum, Jeanette Bonnier, Christo, Jean-Louis Cohen, Erling Kagge, Eberhard W. Kornfeld, Hans Ulrich Obrist, Carrie Pilto, Simon de Pury\\nDesign by Studio Marie Lusa\\n372 pages\\n23.8 × 28.4 cm\\nHardcover\\nISBN 978-0-500-97060-7","nodeType":"text"}],"nodeType":"paragraph"}],"nodeType":"document"}',
