    details: {
      raw: '{"data":{},"content":[{"data":{},"content":[{"data":{},"marks":[],"value":"","nodeType":"text"},{"data":{"uri":"https://steidl.de/Books/Enjoy-your-Life-Mit-dem-Teller-nach-Bonn-3047505354.html?SID=lvejm9lbf72c"},"content":[{"data":{},"marks":[],"value":"Steidl/Bundeskunsthalle","nodeType":"text"}],"nodeType":"hyperlink"},{"data":{},"marks":[],"value":", 2016\\nTexts by Franceso Bonami, Ashley Heath, Monte Packham, Adrian Searle, Juergen Teller, Rein Wolfs\\n\\nDesign by Juergen Teller\\n224 pages\\n23 × 30 cm\\nSoftcover\\nISBN 978-3-95829-187-4","nodeType":"text"}],"nodeType":"paragraph"}],"nodeType":"document"}',
    },
    quote: {
      raw: '{"data":{},"content":[{"data":{},"content":[{"data":{},"content":[{"data":{},"marks":[],"value":"‘Teller assures us that beauty’s not waiting to be attained; rather, it’s ours for the taking. Beauty is imperfection and contradiction. Beauty is attitude, imagination, creation. Beauty is play.’","nodeType":"text"}],"nodeType":"paragraph"}],"nodeType":"blockquote"},{"data":{},"content":[{"data":{},"marks":[],"value":"","nodeType":"text"}],"nodeType":"paragraph"}],"nodeType":"document"}',
    },
    description: {
      raw: '{"data":{},"content":[{"data":{},"content":[{"data":{},"marks":[],"value":"Accompanying his exhibition of the same name at the Bundeskunsthalle Bonn in 2016, Enjoy Your Life! Mit dem Teller nach Bonn presents Juergen Teller’s inimitable photographic universe – ironic, eclectic and democratizing – where glamour and grit happily coexist and traditional notions of beauty are recast. Combining Teller’s fashion, still-life and landscape photography alongside portraits of celebrities and of himself, the book mixes images as unpredictable as Raquel Zimmermann and Charlotte Rampling standing nude before the Mona Lisa, Kim Kardashian posing beside a tractor, a food close-up, Teller’s mother by the woods near his childhood home, and a self-portrait climbing a tree. The playful leitmotif throughout Enjoy Your Life! is the plate (‘Teller’ in the photographer’s native German), both dinner plates and comically large versions printed with Teller’s images, transformed by his sitters into performative props. The result is classic Juergen Teller, a call for us all to revel in the theatre of life.     ","nodeType":"text"}],"nodeType":"paragraph"}],"nodeType":"document"}',
    },
