      raw: '{"data":{},"content":[{"data":{},"content":[{"data":{},"marks":[],"value":"","nodeType":"text"},{"data":{"uri":"http://tarzipan-books.com/"},"content":[{"data":{},"marks":[],"value":"Tarzipan","nodeType":"text"}],"nodeType":"hyperlink"},{"data":{},"marks":[],"value":", 2016","nodeType":"text"}],"nodeType":"paragraph"},{"data":{},"content":[{"data":{},"marks":[],"value":"Text by Monte Packham\\n\\nPhotographs by Roger Ballen, Bela Borsodi, Christopher Bucklow, Denis Darzacq, Doug DuBois, Thekla Ehling, Jason Evans, Nan Goldin, Sarah Illenberger, Peter Lindbergh, Achim Lippoth, John Maclean, Neeta Madahar, Christoph Niemann, Benne Ochs, Martin Parr, Simon Roberts, Julian Röder, Sebastião Salgado, Walter Schels, Robin Schwartz, Alec Soth, Wolfgang Tillmans, Tim Walker, Sascha Weidner, Sylvie Zijlmans","nodeType":"text"}],"nodeType":"paragraph"},{"data":{},"content":[{"data":{},"marks":[],"value":"Design by Joppe Berlin\\n56 pages\\n21.5 × 25.5 cm\\nHardcover\\nISBN 978-0-9554470-7-5","nodeType":"text"}],"nodeType":"paragraph"}],"nodeType":"document"}',
