    quote: {
      raw: '{"data":{},"content":[{"data":{},"content":[{"data":{},"content":[{"data":{},"marks":[],"value":"‘The text, by Monte Packham, is child-friendly and witty, and draws on the images to make a satisfyingly holistic whole.’","nodeType":"text"}],"nodeType":"paragraph"}],"nodeType":"blockquote"},{"data":{},"content":[{"data":{},"marks":[],"value":"– Diane Smyth, www.1854.photography","nodeType":"text"}],"nodeType":"paragraph"},{"data":{},"content":[{"data":{},"marks":[],"value":"","nodeType":"text"}],"nodeType":"paragraph"}],"nodeType":"document"}',
    },
    description: {
      raw: '{"data":{},"content":[{"data":{},"content":[{"data":{},"marks":[],"value":"ABC Photography is a children’s alphabet book exploring the marvellous ins and outs of photography. Through twenty-six images by twenty-six different photographers, each illustrating a particular aspect of the medium – A for art, C for composition, M for memory, P for perspective, T for time – the book takes the reader through a range of artistic and technical concepts. The clear, often humorous text explains ideas in accessible terms – “Juxtapose is a fancy word for putting different things side by side to create something new and exciting” – and encourages children to engage with image-making on their own terms: “Landscape photography is your chance to reinvent nature.” ABC Photography is a playful guide to the medium, inspiring children to think creatively and critically, whether they be looking at or making their own photographs.","nodeType":"text"}],"nodeType":"paragraph"}],"nodeType":"document"}',
    },
