    quote: {
      raw: '{"data":{},"content":[{"data":{},"content":[{"data":{},"content":[{"data":{},"marks":[],"value":"‘These twenty-two stories and Monte Packham’s intelligent afterword offer a solid introduction to the world of this grandiose writer.’","nodeType":"text"}],"nodeType":"paragraph"}],"nodeType":"blockquote"},{"data":{},"content":[{"data":{},"marks":[],"value":"— Neue Zürcher Zeitung","nodeType":"text"}],"nodeType":"paragraph"}],"nodeType":"document"}',
    },
    description: {
      raw: '{"data":{},"content":[{"data":{},"content":[{"data":{},"marks":[],"value":"The short stories of Saki (H. H. Munro) are masterpieces of wit, satire, and often the macabre. Die Rumpelkammer(The Lumber-Room) presents twenty-two of Saki’s best stories, from his cutting parodies of the upper crust of Edwardian England to his menacing yet elegant tales of the occult and death. Here we meet Jane Thropplestance who has managed to forget where she ‘mislaid’ her niece during an afternoon’s shopping; Clovis Sangrail who seemingly transforms his host into a wolf to the horror of her house-guests; Sylvia Seltoun who is trampled to death by a great stag under the spell of Pan; and Mrs. De Ropp, killed by her ten-year-old nephew’s savage ferret. Die Rumpelkammer presents some of Saki’s most famous stories (‘The Boar-Pig’, ‘The Unrest Cure’, ‘Esmé’) alongside lesser known though no less polished tales such as ‘The Name-Day’ and ‘Dusk’. Comic and tragic, light and dark, Saki’s work reminds us that delight and malice often go hand in hand.","nodeType":"text"}],"nodeType":"paragraph"}],"nodeType":"document"}',
    },
