    description: {
      raw: '{"nodeType":"document","data":{},"content":[{"nodeType":"paragraph","data":{},"content":[{"nodeType":"text","value":"One of the world’s most sought-after photographers, Juergen Teller bridges the worlds of fashion, advertising, art, music and celebrity with an unmistakable mix of irony, honesty and anti-establishment flair. This magazine-style book, the catalogue to a major exhibition in his native Germany, captures Teller’s visual universe to date. Employing portraiture, still-life and landscape photography, Teller’s highly intuitive work exposes clichés, champions the everyday, and recasts traditional notions of beauty. Stripped of the glamor of the fashion world, his sitters often find themselves in unexpected, sometimes disturbing contexts where their true selves are revealed.Fascinated by his youth and upbringing, as well as by the role of the photographer today, autobiography is also a strong force in Teller’s candid, often humorous, and inevitably endearing photos.","marks":[],"data":{}}]}]}',
    },
